import Home from "./pages/Home";
import Cart from "./pages/Cart";
import Checkout from "./pages/Checkout";
import { BrowserRouter as Router, Switch,Route} from "react-router-dom";

const App = () => {
  return (
    <Router>
        <Switch>
          <Route path="/">
            <Home/>
          </Route>
        </Switch>
    </Router>
  );
};

export default App;
